DELIMITER $$
CREATE TRIGGER `updatequantity` AFTER INSERT ON `orderitems` FOR EACH ROW BEGIN
	UPDATE menu_table
    SET qty=qty-new.qty
    where dish_name=new.dish_name;
    UPDATE menu_table
    SET avail_status=case when qty=0 then 1
    END
    WHERE dish_name=new.dish_name;
END
$$
